import React from 'react'

function Info(){
    return(
        <div className="main__inner">
            <div>number1</div>
            <div>number2</div>
            <div>number3</div>
            <div>number4</div>
        </div>
    );
}

function MainCont() {
  return (
    <section className="main__cont">
        <Info/>
    </section>
  )
}

export default MainCont
